const idb = window.indexedDB;

(function () {
  // check for IndexedDB support
  if (!window.indexedDB) {
    //    console.log(`Your browser doesn't support IndexedDB`);
    return;
  }

  // open the CRM database with the version 1
  const request = indexedDB.open("CRM", 1);

  // create the Contacts object store and indexes
  request.onupgradeneeded = (event) => {
    let db = event.target.result;

    // create the Contacts object store
    // with auto-increment id
    let store = db.createObjectStore("tbl_rfid", {
      autoIncrement: true,
    });

    // create an index on the email property
    let index = store.createIndex("PACK_EPC", "PACK_EPC", {
      unique: false,
    });

    let index1 = store.createIndex("CC_NO", "CC_EPCNO", {
      unique: false,
    });

    let index2 = store.createIndex("MC_NO", "MC_NO", {
      unique: false,
    });
    let index3 = store.createIndex("SKU_CODE", "SKU_CODE", {
      unique: false,
    });
  };

  // handle the error event
  request.onerror = (event) => {
    //    console.error(`Database error: ${event.target.errorCode}`);
  };

  // handle the success event
  request.onsuccess = (event) => {
    const db = event.target.result;

    if (localStorage.getItem("databaseLength") != data.length) {
      // console.log('data lengyh', data.length);
      for (i = 0; i <= data.length; i++) {
        insertContact(db, data[i], data.length, i);
      }
    } else {
      // console.log('Already Data')
    }
  };

  function insertContact(db, contact, length, index) {
    // create a new transaction
    const txn = db.transaction("tbl_rfid", "readwrite");

    // get the Contacts object store
    const store = txn.objectStore("tbl_rfid");
    // console.log(contact)
    let query = store.add(contact);

    // handle success case
    query.onsuccess = function (event) {
      // console.log(index,length);
      if (index < length) {
        console.log(index,length)
        document.getElementById("loading").style.display = "flex";
      } else {
        localStorage.setItem("databaseLength", length);
        document.getElementById("loading").style.display = "none";
      }
    };

    // handle the error case
    query.onerror = function (event) {};
    // close the database once the
    txn.oncomplete = function () {
      db.close();
    };
  }
})();

(function () {
  let data = [];
  let uniqueArr = [];
  const ldb = idb.open("CRM", 2);
  ldb.onsuccess = function () {
    const db = ldb.result;
    const txn = db.transaction("tbl_rfid", "readonly");
    const store = txn.objectStore("tbl_rfid");
    const index = store.index("CC_NO");
    let query = index.getAll();
    query.onsuccess = (event) => {
      if (!event.target.result) {
        //   console.log(`this ${value} not match`)
      } else {
        event.target.result.map((ele) => data.push(ele.CC_EPCNO));
        uniqueArr = removeDuplicates(data);
        abc(uniqueArr);
        //   console.log(uniqueArr)
      }
    };
  };
})();

var arr = [];

function abc(data) {
  // console.log(data)
  data.map((element) => {
    const ldb = idb.open("CRM", 2);
    ldb.onsuccess = function () {
      const db = ldb.result;
      const txn = db.transaction("tbl_rfid", "readonly");
      const store = txn.objectStore("tbl_rfid");
      const index = store.index("CC_NO");
      let query = index.getAll(element);
      query.onsuccess = (event) => {
        if (!event.target.result) {
          //   console.log(`this ${value} not match`)
        } else {
          let childCube = getUniqueListBy(event.target.result, "PACK_NAME");
          childCube.map((el) => {
            // console.log(el)
            arr.push(el);
          });
          //   console.log(childCube)
        }
      };
    };
  });
}

function getUniqueListBy(arr, key) {
  return [...new Map(arr.map((item) => [item[key], item])).values()];
}

function removeDuplicates(arr) {
  return arr.filter((item, index) => arr.indexOf(item) === index);
}

